BEGIN;

-- Asegurar que existe el constraint de unicidad para el código antes de las inserciones
DO $$ 
BEGIN 
    IF NOT EXISTS (SELECT 1 FROM pg_constraint WHERE conname = 'cat_economic_activities_code_key') THEN
        ALTER TABLE public.cat_economic_activities ADD CONSTRAINT cat_economic_activities_code_key UNIQUE (code);
    END IF;
END $$;

COMMIT;
